import "./nav.css"
import {Typography} from "@mui/material"
function NavBar(){
    return (
        <>
            <nav className="navConatiner">
                <div>
                    <h1>Book Your Order</h1>
                </div>
            </nav>
        </>
    )
}
export default NavBar;
